import{_ as e,c as o,o as t,a2 as r}from"./chunks/framework.DDIT__tB.js";const f=JSON.parse('{"title":"Glossary of Commonly Used Terms","description":"","frontmatter":{},"headers":[],"relativePath":"wiki/glossary.md","filePath":"wiki/glossary.md"}'),i={name:"wiki/glossary.md"};function l(s,a,n,h,d,m){return t(),o("div",null,a[0]||(a[0]=[r('<h1 id="glossary-of-commonly-used-terms" tabindex="-1">Glossary of Commonly Used Terms <a class="header-anchor" href="#glossary-of-commonly-used-terms" aria-label="Permalink to &quot;Glossary of Commonly Used Terms&quot;">​</a></h1><h2 id="data-flow-diagram" tabindex="-1">Data Flow Diagram <a class="header-anchor" href="#data-flow-diagram" aria-label="Permalink to &quot;Data Flow Diagram&quot;">​</a></h2><p>Describes the <a href="/wiki/dfd.html#data-flow-diagram">Data Flow Diagram</a> (the <em><strong>metamodel</strong></em>). Sometimes describes the entire model of a system, including the <a href="/wiki/dfd.html#data-dictionary">Data Dictionary</a> (the <em><strong>modelling framework</strong></em>)</p><h2 id="data-dictionary" tabindex="-1">Data Dictionary <a class="header-anchor" href="#data-dictionary" aria-label="Permalink to &quot;Data Dictionary&quot;">​</a></h2><p>A component of the <a href="/wiki/dfd/">Data Flow Diagram Model</a> responsible for storing <a href="/wiki/glossary.html#node-label">Node Label</a> or <a href="/wiki/glossary.html#data-label">Data Label</a></p><h2 id="palladio-component-model-pcm" tabindex="-1">Palladio Component Model (PCM) <a class="header-anchor" href="#palladio-component-model-pcm" aria-label="Permalink to &quot;Palladio Component Model (PCM)&quot;">​</a></h2><p>An <a href="https://en.wikipedia.org/wiki/Architecture_description_language" target="_blank" rel="noreferrer">Architecture Description Language</a> describing software with several analyses to analyze software quality attributes. Can be used as an input model for the analysis. For more information see: <a href="/wiki/pcm/">Palladio Component Model</a></p><h2 id="characteristic-type" tabindex="-1">Characteristic Type <a class="header-anchor" href="#characteristic-type" aria-label="Permalink to &quot;Characteristic Type&quot;">​</a></h2><p>see <a href="/wiki/glossary.html#label-type">Label Type</a></p><h2 id="characteristic-value" tabindex="-1">Characteristic Value <a class="header-anchor" href="#characteristic-value" aria-label="Permalink to &quot;Characteristic Value&quot;">​</a></h2><p>see <a href="/wiki/glossary.html#label-value">Label (Value)</a></p><h2 id="label-type" tabindex="-1">Label Type <a class="header-anchor" href="#label-type" aria-label="Permalink to &quot;Label Type&quot;">​</a></h2><p>A Property of a <a href="/wiki/glossary.html#node">Node</a> or <a href="/wiki/glossary.html#data-flow">Data Flow</a> with one ore more <a href="/wiki/glossary.html#label-value">Label (Values)</a> For more information see: <a href="/wiki/dfd/index.html#data-dictionary">Data Flow Diagram</a></p><h2 id="label-value" tabindex="-1">Label (Value) <a class="header-anchor" href="#label-value" aria-label="Permalink to &quot;Label (Value)&quot;">​</a></h2><p>A value of a <a href="/wiki/glossary.html#label-type">Label Type</a> describing a property of a <a href="/wiki/glossary.html#node">Node</a> or <a href="/wiki/glossary.html#data-flow">Data Flow</a> For more information see: <a href="/wiki/dfd/index.html#data-dictionary">Data Flow Diagram</a></p><h2 id="source-selector" tabindex="-1">Source Selector <a class="header-anchor" href="#source-selector" aria-label="Permalink to &quot;Source Selector&quot;">​</a></h2><p>A component of the <a href="/wiki/dsl/">Analysis Constraint DSL</a> that describes properties that a <a href="/wiki/glossary.html#node">Node</a> or <a href="/wiki/glossary.html#data-flow">Data Flow</a> needs to have to be matched by the constraint For more information see: <a href="/wiki/dsl/index.html#source">Source Selector</a></p><h2 id="destination-selector" tabindex="-1">Destination Selector <a class="header-anchor" href="#destination-selector" aria-label="Permalink to &quot;Destination Selector&quot;">​</a></h2><p>A component of the <a href="/wiki/dsl/">Analysis Constraint DSL</a> that describes properties that a <a href="/wiki/glossary.html#node">Node</a> or <a href="/wiki/glossary.html#data-flow">Data Flow</a> need to have to be matched by the constraint. For more information see: <a href="/wiki/dsl/index.html#destination">Destination Selector</a></p><h2 id="conditional-selector" tabindex="-1">Conditional Selector <a class="header-anchor" href="#conditional-selector" aria-label="Permalink to &quot;Conditional Selector&quot;">​</a></h2><p>A component of the <a href="/wiki/dsl/">Analysis Constraint DSL</a> that matches <a href="/wiki/glossary.html#node">Nodes</a> based on <a href="/wiki/dsl/index.html#variables">DSL Variables</a>. For more information on variables see: <a href="/wiki/dsl/index.html#variables">DSL Variables</a>. For more information on conditional selectors see: <a href="/wiki/dsl/index.html#conditional">Conditional Selectors</a></p><h2 id="vertex" tabindex="-1">Vertex <a class="header-anchor" href="#vertex" aria-label="Permalink to &quot;Vertex&quot;">​</a></h2><p>A vertex describes an element of a <a href="/wiki/glossary.html#transpose-flow-graph">Transpose Flow Graph</a> that corresponds to exactly one element in the model. Data may flow into and out of the vertex, their properties available as <a href="/wiki/glossary.html#data-label">Data Label</a>. Additionally properties of the vertex are available as <a href="/wiki/glossary.html#node-label">Vertex Label</a>. For more information see: <a href="/wiki/analysis/">Data Flow Analysis</a>.</p><p>Not to be confused with a <a href="/wiki/glossary.html#node">Node</a> that is an element of a <a href="/wiki/dfd.html#data-flow-diagram">Data Flow Diagram</a></p><h2 id="node" tabindex="-1">Node <a class="header-anchor" href="#node" aria-label="Permalink to &quot;Node&quot;">​</a></h2><p>A node describes an element of an <a href="/wiki/dfd.html#data-flow-diagram">Data Flow Diagram</a>.</p><p>Not to be confused with a <a href="/wiki/glossary.html#vertex">Vertex</a> that is part of an <a href="/wiki/glossary.html#transpose-flow-graph">Transpose Flow Graph</a></p><h2 id="source" tabindex="-1">Source <a class="header-anchor" href="#source" aria-label="Permalink to &quot;Source&quot;">​</a></h2><p>A Source is a special <a href="/wiki/glossary.html#vertex">Vertex</a> that data does not flow into. It only has outgoing data. For more information see: <a href="/wiki/analysis/">Data Flow Analysis</a></p><h2 id="sink" tabindex="-1">Sink <a class="header-anchor" href="#sink" aria-label="Permalink to &quot;Sink&quot;">​</a></h2><p>A Sink is a special <a href="/wiki/glossary.html#vertex">Vertex</a> that data does not flow out of. It only has incoming data and clearly defines a <a href="/wiki/glossary.html#transpose-flow-graph">Transpose Flow Graph</a> with its previous nodes. For more information see: <a href="/wiki/analysis/">Data Flow Analysis</a></p><h2 id="data-flow" tabindex="-1">Data Flow <a class="header-anchor" href="#data-flow" aria-label="Permalink to &quot;Data Flow&quot;">​</a></h2><p>A Data Flow describes a flow from one <a href="/wiki/glossary.html#node">Node</a> to another <a href="/wiki/glossary.html#node">Node</a>. It may has certain properties after <a href="/wiki/analysis/label-propagation.html">Label Propagation</a></p><h2 id="transpose-flow-graph" tabindex="-1">Transpose Flow Graph <a class="header-anchor" href="#transpose-flow-graph" aria-label="Permalink to &quot;Transpose Flow Graph&quot;">​</a></h2><p>A Transpose Flow Graph describes a unique flow though the software system and can be identified using a <a href="/wiki/glossary.html#sink">Sink</a></p><h2 id="node-label" tabindex="-1">Node Label <a class="header-anchor" href="#node-label" aria-label="Permalink to &quot;Node Label&quot;">​</a></h2><p>A Node Label is a <a href="/wiki/glossary.html#label-value">Label Value</a> that is applied to a <a href="/wiki/glossary.html#node">Node</a>. It can be used in a <a href="/wiki/dsl/">DSL Constraint</a> to match vertices using their vertex/node label</p><h2 id="data-label" tabindex="-1">Data Label <a class="header-anchor" href="#data-label" aria-label="Permalink to &quot;Data Label&quot;">​</a></h2><p>A Data Label is a <a href="/wiki/glossary.html#label-value">Label Value</a> that is applied to a <a href="/wiki/glossary.html#data-flow">Data Flow</a>. It can be used in a <a href="/wiki/dsl/">DSL Constraint</a> to match vertices using their vertex/node label</p>',39)]))}const p=e(i,[["render",l]]);export{f as __pageData,p as default};
